import React, { Component } from "react";
import './App.css';

import { BrowserRouter as Router, Route, Switch, Link, Redirect } from "react-router-dom";


//Pages
import Home from "./pages";


class App extends Component {
    render() {
        return <Router>
            <Route path="/" Component={Home} />
        </Router>
    }
}
export default App;



